import React from "react";

export const FilmCard = ({movie}) => {
    console.log(movie)

    const title = movie.Title;

    return (
        <div id="filmCard">
            <h1>{movie.Title}</h1>
            <div>
            <img src={movie.Poster} />
            <li>
                <ul>{movie.Title}</ul>
                <ul>{movie.Year}</ul>
                <ul>{movie.Rated}</ul>
                <ul>{movie.Plot}</ul>
            </li>
            </div>
        </div>
    );
    }
